# Sort tokens by 1-hour volume (h1 volume) in descending order
def sort_by_volume_h1(data):
    # Convert dictionary to list of tuples (token_address, token_data) and sort by h1 volume
    sorted_tokens = sorted(
        data.items(), 
        key=lambda x: x[1]['volume']['h1'], 
        reverse=True  # Descending order (highest volume first)
    )
    return sorted_tokens

# Function to display sorted results
def display_sorted_tokens(sorted_tokens):
    print("=" * 100)
    print("TOKENS SORTED BY 1-HOUR VOLUME (Highest to Lowest)")
    print("=" * 100)
    print(f"{'Rank':<4} {'Symbol':<12} {'Name':<30} {'Vol 1H':<12} {'Price USD':<12} {'Change 1H':<10}")
    print("-" * 100)
    
    for i, (address, token_data) in enumerate(sorted_tokens, 1):
        symbol = token_data['baseToken']['symbol']
        name = token_data['baseToken']['name'][:30]  # Truncate long names
        volume_h1 = token_data['volume']['h1']
        price_usd = token_data['priceUsd']
        change_h1 = token_data['priceChange'].get('h1', 'N/A')
        
        print(f"{i:<4} {symbol:<12} {name:<30} {volume_h1:<12.2f} ${price_usd:<11} {change_h1:<10}")

# Sort the data
sorted_data = sort_by_volume_h1(data)

# Display results
display_sorted_tokens(sorted_data)

